<p>
<b>ObjectIdentification</b></p>
</body>
</html></richcontent>
<richcontent TYPE="NOTE"><html>
  <head>
    
  </head>
  <body>

    <p align="left">Documents one or more unique ID&apos;s

This clause includes data elements that jointly comprise a unique identifier for subjects of care. This clause outlines subject identifiers. See Figure 2.
The combination of the subject identifier and the health care organization, the type of identifier and the name given to the identifier in the organization is one way to indicate unique identification of the subject of care.
Subject of care identifier may also be known as:
? patient ID (HL7);
? person identifier;
? unit record number (URN);
? medical record number (MRN);
? local subject identifier;
? subject identification number;
? enterprise identifier;
? area identifier;
? province/state/territory identifier;
? unique identifier (UID);
? unique health identifier (UHID).</p>
<br></br>
<p align="left"> Occurences {0..*} </p>
</body>
</html></richcontent>
