<richcontent TYPE="NOTE"><html>
  <head>
    
  </head>
  <body>

    <p align="left">The type of the identifier within the organization (e.g. unique patient identifier, health care card, pension card).

Examples of subject of care identifier names could include:
01 — Unique identifier within this organization (to be used where only one number is used for identification within the organization)
02 — Medical record number, patient record number, UR number Service-specific numbers – for numbers issued by a specific service. Service-specific examples:
21 — radiology 22 — pathology 23 — pharmacy
Identification numbers indicating examples of card types: 31 — top level cover card
32 — medium level cover card
33 — lowest level cover card
51 — insurance/finance/pension number
82 — research purpose number</p>
