<node BACKGROUND_COLOR="#ccccff" CREATED="1359362179298" FOLDED="true" ID="_content[at0003]_members[at0004]_members[at0019]_members[at0020]_members[at0047]_items[at7058]_parts[at7474]_parts[at7507]_parts[at1481]_parts[at1482]_parts[at1484]_parts[at1489]_parts[at1500]_parts[at1539]" MODIFIED="1364229577700" STYLE="bubble">
<richcontent TYPE="NODE"><html>
